query:
SELECT ?uri WHERE
{
  ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/EatingDisorders> .
  ?uri <http://jena.apache.org/text#"characterized> by" "appetite for clay and sand" .
}

SELECT ?n 
WHERE {
        <http://dbpedia.org/resource/Steve_Jobs> <http://dbpedia.org/ontology/relative> ?uri .
        ?uri <http://jena.apache.org/text#"first> met him when she was" ?n .
}

SELECT DISTINCT ?name 
WHERE {
        <http://jena.apache.org/text#"tallest> building in Japan" <http://dbpedia.org/ontology/architect> ?uri .  
}

SELECT DISTINCT ?uri 
WHERE {
	?uri rdf:type <http://dbpedia.org/ontology/Bird> .	
	?uri <http://jena.apache.org/text#"protected> under" <http://jena.apache.org/text#"National> Parks and Wildlife Act".

}

SELECT DISTINCT ?uri 
WHERE {
        ?x <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
        ?x <http://jena.apache.org/text#"depicts> the early life of" <http://jena.apache.org/text#"Jane> Austin" .
        ?x <http://dbpedia.org/ontology/musicComposer> ?uri .
}

SELECT ?n 
WHERE {
        <http://dbpedia.org/resource/Steve_Jobs> <http://dbpedia.org/ontology/relative> ?uri .
        ?uri <http://jena.apache.org/text#"did> not meet until she was" ?n .
}

SELECT ?uri WHERE
{
  ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/EatingDisorders> .
  ?uri <http://jena.apache.org/text#"characterized> by" "appetite for clay and sand" .
}

SELECT ?n
WHERE {
        ?uri <http://dbpedia.org/ontology/parent> <http://dbpedia.org/resource/Henry_Fonda> .
        ?uri <http://jena.apache.org/text#"number> of Golden Globe awards" ?n .
}

SELECT DISTINCT ?uri 
WHERE {
	?uri <http://jena.apache.org/text#"is"> <http://jena.apache.org/text#"first> known photographer of snowflakes" .
	?uri <http://dbpedia.org/ontology/birthPlace> ?x .
        ?x rdf:type <http://dbpedia.org/ontology/Country> .	
}

SELECT DISTINCT ?uri 
WHERE {
        ?uri <http://dbpedia.org/ontology/architect> <http://dbpedia.org/resource/Shreve,_Lamb_&_Harmon> .
      { ?uri <http://dbpedia.org/ontology/architect>uralStyle <http://dbpedia.org/resource/Art_Deco> . }
      UNION
      { ?uri text:"style text:"art deco" . } 
}

SELECT DISTINCT ?uri 
WHERE {
        ?x <http://jena.apache.org/text#"considered"> <http://jena.apache.org/text#"national> poet of Greece" .
        ?x <http://dbpedia.org/ontology/deathPlace> ?uri .
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/Island109316454> .
}

SELECT DISTINCT ?string 
WHERE {
        <http://dbpedia.org/resource/James_Bond> <http://dbpedia.org/ontology/lastAppearance> ?x .
        ?x <http://jena.apache.org/text#"feature> as James Bond" ?string .
}

SELECT DISTINCT ?uri
WHERE {
        ?x <http://jena.apache.org/text#"authorized"> <http://jena.apache.org/text#"atomic> weapons against Japan" .
        ?x <http://dbpedia.org/ontology/vicePresident> ?uri .
}

SELECT DISTINCT ?uri 
WHERE {
	<http://dbpedia.org/resource/Friends> <http://dbpedia.org/ontology/starring> ?uri .	
	?uri <http://jena.apache.org/text#"own"> <http://jena.apache.org/text#"the> production company Coquette Productions" .
}

SELECT DISTINCT ?uri
WHERE {
        ?uri rdf:type <http://dbpedia.org/ontology/Writer> . 
        ?uri text:"converted to" text:"Islam" . 
}

SELECT DISTINCT ?uri 
WHERE {
        ?x <http://jena.apache.org/text#"known> as" <http://jena.apache.org/text#"The> Long Fellow" .
        ?x <http://dbpedia.org/ontology/raceHorse> ?uri .
}

SELECT DISTINCT ?uri 
WHERE {
        ?uri <http://dbpedia.org/ontology/office> "United States Secretary of State" . 
        ?uri <http://jena.apache.org/text#"significiantly> involved in" <http://jena.apache.org/text#"United> States' dominance of the Caribbean" .
}

SELECT DISTINCT ?uri ?abstract
WHERE {
        ?uri <http://dbpedia.org/ontology/field> <http://dbpedia.org/resource/Mathematics> .
        ?uri <http://dbpedia.org/ontology/birthPlace> <http://dbpedia.org/resource/Germany> .
        ?uri <http://jena.apache.org/text#"member> of" <http://jena.apache.org/text#"von> Braun rocket group" .
}

SELECT DISTINCT ?uri 
WHERE {
	?uri <http://dbpedia.org/ontology/award> <http://dbpedia.org/resource/Victoria_Cross> .
	?uri <http://jena.apache.org/text#"died> in" <http://jena.apache.org/text#"Battle> of Arnhem" .
}


SELECT DISTINCT ?uri
WHERE {
        ?x <http://jena.apache.org/text#"is"> <http://jena.apache.org/text#"first> person to climb all fourteen eight-thousanders" .
        ?x <http://dbpedia.org/ontology/birthPlace> ?uri .
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Settlement> .
}

SELECT DISTINCT ?uri 
WHERE {
	?uri <http://jena.apache.org/text#"member> of" <http://jena.apache.org/text#"the> African Union" .	
	?uri <http://dbpedia.org/ontology/capital> <http://dbpedia.org/resource/Dakar> .
}

SELECT DISTINCT ?uri 
WHERE { 
        <http://dbpedia.org/resource/William_Faulkner> <http://jena.apache.org/text#"spent> most of his life in" ?x . 
        ?x <http://dbpedia.org/ontology/largestCity> ?uri . 
}

SELECT DISTINCT ?uri
WHERE {
        ?x <http://jena.apache.org/text#"is"> <http://jena.apache.org/text#"first> man in space" .
        ?x <http://dbpedia.org/ontology/deathPlace> ?uri .
}

SELECT DISTINCT ?string
WHERE {
        ?x <http://jena.apache.org/text#"is"> <http://jena.apache.org/text#"the> only American actor that received the César Award" .
        ?x <http://dbpedia.org/ontology/almaMater> ?uri .
}

SELECT DISTINCT ?uri
WHERE {
         ?uri <http://dbpedia.org/ontology/office> 'President of the United States' .
         ?uri <http://dbpedia.org/ontology/orderInOffice> '16th' .
}
